body:
В 20:00 начинаем наш стрим «Прекрасная Россия бу-бу-бу»:

— Лукашенко внезапно провёл собственную инаугурацию — улицы готовятся к протестам;

— родители выводят детей на протесты. Зачем? Обсуждаем с Сергеем Марданом;

— даём советы ООН, как выжить в современном мире, вместе с профессором МГИМО, МГУ и ВШЭ Александром Никитиным;

— Навальный выписан из берлинской «Шарите» после предполагаемого отравления «Новичком».

А также с Александром Дворкиным поговорим о секте Виссариона

https://youtu.be/_4_NkrpBva8

В 15:00 начинаем наш стрим «Прекрасная Россия бу-бу-бу»: 
 
— смотрим и комментируем очередной «Марш справедливости» в Минске; 
 
— интервью Марии Певчих — узнаем детали путешествия бутылки с «Новичком» по России; 
 
— а также проанализируем главное из интервью NEXTA блогеру Дудю 
 
https://youtu.be/RRihNefSOgg
